  false,\n\t\"url\": null,\n\t\"notes\": \"This management plan provides well defined
  guidelines to accomplish the following goals at Erie National Wildlife Refuge :
  1) to manage existing grasslands, 2) revert brushland back to grassland, and 3)
  establish approximately 100 acres of native warm-season grasslands during a four
  year trial period ending in 1983. These grasslands will include a mixture of big
  bluestem, little bluestem, indiangrass, and switchgrass.\",\n\t\"license_title\":
